"use strict";(self.webpackChunkunityquest_chronicles_of_love=self.webpackChunkunityquest_chronicles_of_love||[]).push([[7731],{3183:(e,t,n)=>{n.r(t),n.d(t,{default:()=>i,johnChapter10PL:()=>r});const r={chapter:10,title:"Jean 10",version:"Gda\u0144sk Bible 1632",language:"pl",direction:"ltr",verses:[{number:1,text:"Zaprawd\u0119, zaprawd\u0119 powiadam wam: Kto nie wchodzi drzwiami do owczarni, ale wchodzi in\u0119dy, ten jest z\u0142odziejem i \u0142otrem.",strong:[{text:"dans",strong:"H6887",start:73,end:77}]},{number:2,text:"Ale kto wchodzi drzwiami, pasterz jest owiec.",strong:[{text:"berger",strong:"G4166",start:41,end:47},{text:"brebis",strong:"G4263",start:52,end:58}]},{number:3,text:"Temu od\u017awierny otwiera, a owce g\u0142osu jego s\u0142uchaj\u0105, i owce swoje wo\u0142a po imieniu, i wywodzi je.",strong:[{text:"brebis",strong:"G4263",start:29,end:35},{text:"brebis",strong:"G4263",start:83,end:89}]},{number:4,text:"A gdy owce swoje wypu\u015bci, przed nimi idzie, a owce go id\u0105 za nim; bo znaj\u0105 g\u0142os jego.",strong:[{text:"brebis",strong:"G4263",start:43,end:49},{text:"brebis",strong:"G4263",start:82,end:88}]},{number:5,text:"Ale za obcym nie p\xf3jd\u0105, owszem uciekn\u0105 od niego; bo nie znaj\u0105 g\u0142osu obcych.",strong:[]},{number:6,text:"To im podobie\u0144stwo powiedzia\u0142 Jezus; ale oni nie zrozumieli, co to by\u0142o, co im m\xf3wi\u0142.",strong:[{text:"cette",strong:"G3778",start:15,end:20}]},{number:7,text:"Tedy im zasi\u0119 rzek\u0142 Jezus: Zaprawd\u0119, zaprawd\u0119 powiadam wam: \u017bem ja jest drzwi owiec.",strong:[{text:"brebis",strong:"G4263",start:87,end:93}]},{number:8,text:"Wszyscy, kt\xf3rzy przed przyszli, z\u0142odziejami s\u0105 i \u0142otrami; ale ich owce nie s\u0142ucha\u0142y.",strong:[{text:"brebis",strong:"G4263",start:78,end:84}]},{number:9,text:"Jam jest drzwi; przeze mnie je\u017aliby kto wszed\u0142, zbawion b\u0119dzie, i wchodzi\u0107 b\u0119dzie, i wychodzi\u0107, a pastw\u0119 znajdzie.",strong:[]},{number:10,text:"Z\u0142odziej nie przychodzi, tylko aby krad\u0142 i zabija\u0142, i traci\u0142; jam przyszed\u0142, aby \u017cywot mieli, i obfito\u015b\u0107 mieli.",strong:[{text:"brebis",strong:"G4263",start:89,end:95},{text:"dans",strong:"H6887",start:129,end:133},{text:"abondance",strong:"G4138",start:136,end:145}]},{number:11,text:"Jam jest pasterz dobry; pasterz dobry dusz\u0119 swoj\u0119 k\u0142adzie za owce.",strong:[{text:"berger",strong:"G4166",start:15,end:21},{text:"berger",strong:"G4166",start:30,end:36},{text:"brebis",strong:"G4263",start:59,end:65}]},{number:12,text:"Ale najemnik, i kt\xf3ry nie jest pasterzem, kt\xf3rego nie s\u0105 owce w\u0142asnemi, widzi wilka id\u0105cego, i opuszcza owce, i ucieka, a wilk porywa i rozprasza owce.",strong:[{text:"berger",strong:"G4166",start:37,end:43},{text:"brebis",strong:"G4263",start:78,end:84},{text:"brebis",strong:"G4263",start:120,end:126}]},{number:13,text:"A najemnik ucieka, przeto i\u017c jest najemnik, a nie dba o owce.",strong:[{text:"brebis",strong:"G4263",start:90,end:96}]},{number:14,text:"Jam jest pasterz dobry, i znam owce moje, i znaj\u0105 mi\u0119 moje.",strong:[{text:"berger",strong:"G4166",start:15,end:21},{text:"brebis",strong:"G4263",start:38,end:44}]},{number:15,text:"Jako mi\u0119 zna Ojciec, tak ja znam Ojca; a dusz\u0119 moj\u0119 k\u0142ad\u0119 za owce.",strong:[{text:"comme",strong:"G2531",start:0,end:5},{text:"comme",strong:"G2531",start:28,end:33},{text:"brebis",strong:"G4263",start:82,end:88}]},{number:16,text:"Mamci i inne owce, kt\xf3re nie s\u0105 z tej owczarni; i te musz\u0119 przywie\u015b\u0107, a g\u0142osu mego s\u0142ucha\u0107 b\u0119d\u0105; i b\u0119dzie jeden owczarnia, i jeden pasterz.",strong:[{text:"brebis",strong:"G4263",start:21,end:27},{text:"cette",strong:"G3778",start:48,end:53},{text:"seul",strong:"G3439",start:143,end:147},{text:"seul",strong:"G3439",start:161,end:165},{text:"berger",strong:"G4166",start:166,end:172}]},{number:17,text:"Dlatego mi\u0119 Ojciec mi\u0142uje, \u017ce ja k\u0142ad\u0119 dusz\u0119 moj\u0119, abym j\u0105 zasi\u0119 wzi\u0105\u0142.",strong:[]},{number:18,text:"Nikt jej ode mnie nie bierze, ale ja j\u0105 sam k\u0142ad\u0119 od siebie; mam moc po\u0142o\u017cy\u0107 j\u0105, i mam moc zasi\u0119 wzi\u0105\u0107 j\u0105. To przykazanie wzi\u0105\u0142em od Ojca mego.",strong:[{text:"Personne",strong:"G3762",start:0,end:8},{text:"donner",strong:"G1325",start:74,end:80},{text:"ordre",strong:"G1785",start:128,end:133}]},{number:19,text:"I znowu powsta\u0142o rozerwanie mi\u0119dzy \u017bydami dla tych s\u0142\xf3w.",strong:[{text:"nouveau",strong:"G2537",start:12,end:19}]},{number:20,text:"A m\xf3wili ich wiele: Dyjabelstwo ma, i szaleje; przecz\u017ce go s\u0142uchacie?",strong:[]},{number:21,text:"Drudzy m\xf3wili: Te s\u0142owa nie s\u0105 cz\u0142owieka dyjabelstwo maj\u0105cego. Aza\u017c dyabel mo\u017ce \u015blepych oczy otwiera\u0107?",strong:[]},{number:22,text:"I by\u0142o po\u015bwi\u0119cenie ko\u015bcio\u0142a w Jeruzalemie, i by\u0142a zima.",strong:[]},{number:23,text:"I chodzi\u0142 Jezus w ko\u015bciele po przysionku Salomonowym.",strong:[{text:"dans",strong:"H6887",start:22,end:26}]},{number:24,text:"Tedy go obst\u0105pili \u017bydowie, i m\xf3wili mu: Dok\u0105d\u017ce dusz\u0119 nasz\u0119 zawiesisz? Je\u017ali ty jeste\u015b Chrystus, powiedz nam jawnie.",strong:[{text:"esprit",strong:"G4151",start:74,end:80},{text:"Christ",strong:"G5547",start:105,end:111}]},{number:25,text:"Odpowiedzia\u0142 im Jezus: Powiedzia\u0142em wam, a nie wierzycie; sprawy, kt\xf3re ja czyni\u0119 w imieniu Ojca mego, te \u015bwiadcz\u0105 o mnie.",strong:[]},{number:26,text:"Ale wy nie wierzycie; bo nie jeste\u015bcie z owiec moich, jakom wam powiedzia\u0142.",strong:[{text:"brebis",strong:"G4263",start:58,end:64}]},{number:27,text:"Owce moje g\u0142osu mego s\u0142uchaj\u0105, a ja znam je, i id\u0105 za mn\u0105.",strong:[{text:"brebis",strong:"G4263",start:4,end:10}]},{number:28,text:"A ja \u017cywot wieczny daj\u0119 im, i nie zgin\u0105 na wieki, a nie wydrze ich \u017caden z r\u0119ki mojej.",strong:[{text:"personne",strong:"G3762",start:64,end:72},{text:"main",strong:"G5495",start:93,end:97}]},{number:29,text:"Ojciec m\xf3j, kt\xf3ry mi je da\u0142, wi\u0119kszy jest nad wszystko, a \u017caden ich nie mo\u017ce wydrze\u0107 z r\u0119ki Ojca mego.",strong:[{text:"grand",strong:"G3173",start:41,end:46},{text:"personne",strong:"G3762",start:60,end:68},{text:"main",strong:"G5495",start:93,end:97}]},{number:30,text:"Ja i Ojciec jedno jeste\u015bmy.",strong:[]},{number:31,text:"Tedy porwali zasi\u0119 kamienie \u017bydowie, aby go kamionowali.",strong:[{text:"nouveau",strong:"G2537",start:27,end:34}]},{number:32,text:"Odpowiedzia\u0142 im Jezus: Wiele dobrych spraw pokaza\u0142em wam od Ojca mego; dla kt\xf3rej z tych spraw mi\u0119 kamionujecie?",strong:[{text:"voir",strong:"G1492",start:32,end:36}]},{number:33,text:"Odpowiedzieli mu \u017bydowie, m\xf3wi\u0105c: Nie dla dobrego uczynku kamionujemy ci\u0119, ale dla blu\u017anierstwa, a i\u017c ty, b\u0119d\u0105c cz\u0142owiekiem, czynisz si\u0119 Bogiem.",strong:[{text:"homme",strong:"G444",start:137,end:142},{text:"Dieu",strong:"G2316",start:155,end:159}]},{number:34,text:"Odpowiedzia\u0142 im Jezus: Aza\u017c nie jest napisano w zakonie waszym: Ja rzek\u0142em: Bogowie jeste\u015bcie?",strong:[{text:"dans",strong:"H6887",start:40,end:44},{text:"dieux",strong:"H430",start:80,end:85}]},{number:35,text:"Je\u017ali one nazwa\u0142 bogami, do kt\xf3rych s\u0142owo Bo\u017ce sta\u0142o si\u0119, (a nie mo\u017ce by\u0107 wzruszone Pismo,)",strong:[{text:"dieux",strong:"H430",start:17,end:22},{text:"parole",strong:"G3056",start:37,end:43},{text:"Dieu",strong:"G2316",start:47,end:51}]},{number:36,text:"Wy o tym, kt\xf3rego Ojciec po\u015bwi\u0119ci\u0142 i pos\u0142a\u0142 na \u015bwiat, powiadacie, \u017ce blu\u017ani, i\u017cem rzek\u0142: Synem Bo\u017cym jestem?",strong:[{text:"dans",strong:"H6887",start:40,end:44},{text:"monde",strong:"G2889",start:48,end:53},{text:"Fils",strong:"G5207",start:125,end:129},{text:"Dieu",strong:"G2316",start:133,end:137}]},{number:37,text:"Je\u017ali nie czyni\u0119 spraw Ojca mego, nie wierzcie mi.",strong:[]},{number:38,text:"Ale je\u017ali czyni\u0119, cho\u0107by\u015bcie mi nie wierzyli, sprawom wierzcie, aby\u015bcie poznali i uwierzyli, \u017ce Ojciec we mnie jest, a ja w nim.",strong:[{text:"dans",strong:"H6887",start:157,end:161}]},{number:39,text:"Przeto\u017c go zasi\u0119 szukali pojma\u0107; ale uszed\u0142 z r\u0105k ich.",strong:[]},{number:40,text:"I odszed\u0142 zasi\u0119 za Jordan na ono miejsce, gdzie Jan by\u0142 naprz\xf3d chrzci\u0142, i tam zosta\u0142.",strong:[{text:"nouveau",strong:"G2537",start:19,end:26},{text:"dans",strong:"H6887",start:48,end:52},{text:"Jean",strong:"G2491",start:64,end:68}]},{number:41,text:"I przysz\u0142o ich do niego wiele, i m\xf3wili: \u017be Jan \u017cadnego znaku nie uczyni\u0142; ale wszystko, co Jan powiedzia\u0142 o tym, by\u0142o prawdziwe.",strong:[{text:"Beaucoup",strong:"G4183",start:0,end:8},{text:"Jean",strong:"G2491",start:49,end:53},{text:"aucun",strong:"G3762",start:63,end:68},{text:"miracle",strong:"G1411",start:69,end:76},{text:"tout",strong:"G3956",start:83,end:87},{text:"Jean",strong:"G2491",start:95,end:99},{text:"homme",strong:"G444",start:113,end:118}]},{number:42,text:"I uwierzyli tam we\u0144 wiele ich.",strong:[{text:"dans",strong:"H6887",start:4,end:8}]}]},i=r}}]);
